function FileMenu_Callbackdata=get(gcf,'UserData');set(findobj('Tag','Print'),'Enable','on')set(findobj('Tag','Save_Model'),'Enable','on')set(findobj('Tag','Open_Model'),'Enable','on')set(findobj('Tag','Open_FieldData'),'Enable','on');if isfield(data,'obs')	set(findobj('Tag','Unplot_FieldData'),'Enable','on');else	set(findobj('Tag','Unplot_FieldData'),'Enable','off');	set(findobj('Tag','Open_FieldData'),'Enable','on');endset(gcf,'UserData',data)